import { Link } from "react-router-dom";


const Navbar = () => {

    return ( 
        <nav className="navbar">
        <h1>Sams Dashboard</h1>
        <div className="links">
        <Link to="/">Home</Link>
        <Link href="/projects">Projects</Link>
        </div>
        </nav>
    )
}
 
export default Navbar;
